function getRestaurants(){axios.get("http://localhost:7071/api/getshit?lat=52.9548&lng=-1.1581").then(function(o){for(var n=0;n<o.data.length;n++)L.marker([o.data[n].lat,o.data[n].lng],{icon:cutleryIconColour(o.data[n].foodHygieneRating),alt:o.data[n].name,title:o.data[n].name}).addTo(mymap).bindPopup(o.data[n].name+" : Food Hygiene Rating - "+o.data[n].foodHygieneRating);console.log(o.data)}).catch(function(o){console.log(o)})}function cutleryIconColour(o){return"2"===o?L.icon({iconUrl:"./img/markers/cutlery-yellow.svg",iconSize:[36,36],iconAnchor:[0,0],popupAnchor:[18,-3]}):"1"===o?L.icon({iconUrl:"./img/markers/cutlery-orange.svg",iconSize:[36,36],iconAnchor:[0,0],popupAnchor:[18,-3]}):"0"===o?L.icon({iconUrl:"./img/markers/cutlery-red.svg",iconSize:[36,36],iconAnchor:[0,0],popupAnchor:[18,-3]}):L.icon({iconUrl:"./img/markers/cutlery.svg",iconSize:[36,36],iconAnchor:[0,0],popupAnchor:[18,-3]})}